
var index_ = 1;

function GLtexture(gl_, source_, index_) {
    this.index = index_;
    this.img = new Image();
    if(this.index == BRICK_TEXTURE) { 
	this.img.src = "data:image/jpg;base64,";
    } 
    else if(this.index == WOOD_TEXTURE) { 
	this.img.src = "data:image/jpg;base64,";
    } else if(this.index == RUG_TEXTURE) { 
	this.img.src = "data:image/jpg;base64,";
    } else if(this.index == HEAVEN_TEXTURE) { 
	this.img.src = "data:image/jpg;base64,";
} else if(this.index == FLOOR_TEXTURE) {
    this.img.src = "data:image/jpg;base64,";
} else if(this.index == SKYBOX_TEXTURE_1) { this.img.src = "data:image/jpg;base64,";
} else if(this.index == SKYBOX_TEXTURE_2) { this.img.src = "data:image/jpg;base64,";
} else if(this.index == SKYBOX_TEXTURE_3) { this.img.src = "data:image/jpg;base64,";
} else if(this.index == SKYBOX_TEXTURE_4) { this.img.src = "data:image/jpg;base64,";
} else if(this.index == SKYBOX_TEXTURE_5) { this.img.src = "data:image/jpg;base64,";
} else if(this.index == SKYBOX_TEXTURE_0) { this.img.src = "data:image/jpg;base64,";

} else { this.img.src = "data:image/jpg;base64,";
}
    var texture_loaded = false;
    this.img.onload = this.init.bind(this,gl_);
    this.img.onerror = function(){ alert("problem with texture " + 
					 this.index); }
    
//    while(!texture_loaded) {;}
  //  this.init(gl_);

    return this;
}
GLtexture.prototype.init = function(gl_){
//    alert("texture " + this.index);
    gl_.activeTexture(gl_.TEXTURE0 + this.index);
    gl_.bindTexture(gl_.TEXTURE_2D, gl_.createTexture());
    gl_.texImage2D(gl_.TEXTURE_2D, 0, 
		   gl_.RGBA, gl_.RGBA, 
		   gl_.UNSIGNED_BYTE, this.img);
    gl_.texParameteri(gl_.TEXTURE_2D, 
		      gl_.TEXTURE_MAG_FILTER, 
		      gl_.LINEAR);
    gl_.texParameteri(gl_.TEXTURE_2D, 
		      gl_.TEXTURE_MIN_FILTER, 
		      gl_.LINEAR_MIPMAP_NEAREST);
    gl_.generateMipmap(gl_.TEXTURE_2D);
    return this;
}
